import React, { useState } from "react";
import "../styles/PropertyDetails.css";

const PropertyDetails = () => {
  const [property, setProperty] = useState({
    country: "",
    state: "",
    city: "",
    area: "",
    rooms: "",
    type: "",
  });

  const [owner, setOwner] = useState({
    name: "",
    email: "",
    birthDate: "",
    contact: "",
    address: "",
  });

  const [agent, setAgent] = useState({
    name: "",
    email: "",
    birthDate: "",
    contact: "",
    address: "",
  });

  const handleSubmit = (e) => {
    e.preventDefault();
    console.log("Property Details:", property);
    console.log("Owner Details:", owner);
    console.log("Agent Details:", agent);
    alert("Dados salvos com sucesso!");
  };

  return (
    <div className="property-details">
      <h1>Detalhes do Imóvel</h1>
      <form onSubmit={handleSubmit}>
        {/* Dados do Imóvel */}
        <section>
          <h2>Dados do Imóvel</h2>
          <input
            type="text"
            placeholder="País"
            value={property.country}
            onChange={(e) => setProperty({ ...property, country: e.target.value })}
          />
          <input
            type="text"
            placeholder="Estado"
            value={property.state}
            onChange={(e) => setProperty({ ...property, state: e.target.value })}
          />
          <input
            type="text"
            placeholder="Cidade"
            value={property.city}
            onChange={(e) => setProperty({ ...property, city: e.target.value })}
          />
          <input
            type="text"
            placeholder="Área (m²)"
            value={property.area}
            onChange={(e) => setProperty({ ...property, area: e.target.value })}
          />
          <input
            type="text"
            placeholder="Cômodos"
            value={property.rooms}
            onChange={(e) => setProperty({ ...property, rooms: e.target.value })}
          />
          <input
            type="text"
            placeholder="Tipo (Residencial/Comercial)"
            value={property.type}
            onChange={(e) => setProperty({ ...property, type: e.target.value })}
          />
        </section>

        {/* Dados do Proprietário */}
        <section>
          <h2>Dados do Proprietário</h2>
          <input
            type="text"
            placeholder="Nome"
            value={owner.name}
            onChange={(e) => setOwner({ ...owner, name: e.target.value })}
          />
          <input
            type="email"
            placeholder="Email"
            value={owner.email}
            onChange={(e) => setOwner({ ...owner, email: e.target.value })}
          />
          <input
            type="date"
            value={owner.birthDate}
            onChange={(e) => setOwner({ ...owner, birthDate: e.target.value })}
          />
          <input
            type="text"
            placeholder="Contato"
            value={owner.contact}
            onChange={(e) => setOwner({ ...owner, contact: e.target.value })}
          />
          <input
            type="text"
            placeholder="Endereço"
            value={owner.address}
            onChange={(e) => setOwner({ ...owner, address: e.target.value })}
          />
        </section>

        {/* Dados do Corretor */}
        <section>
          <h2>Dados do Corretor</h2>
          <input
            type="text"
            placeholder="Nome"
            value={agent.name}
            onChange={(e) => setAgent({ ...agent, name: e.target.value })}
          />
          <input
            type="email"
            placeholder="Email"
            value={agent.email}
            onChange={(e) => setAgent({ ...agent, email: e.target.value })}
          />
          <input
            type="date"
            value={agent.birthDate}
            onChange={(e) => setAgent({ ...agent, birthDate: e.target.value })}
          />
          <input
            type="text"
            placeholder="Contato"
            value={agent.contact}
            onChange={(e) => setAgent({ ...agent, contact: e.target.value })}
          />
          <input
            type="text"
            placeholder="Endereço"
            value={agent.address}
            onChange={(e) => setAgent({ ...agent, address: e.target.value })}
          />
        </section>

        {/* Botão Final */}
        <button type="submit" className="btn-save">
          Vender - Adicionar Dados do Comprador
        </button>
      </form>
    </div>
  );
};

export default PropertyDetails;
